import React, { useState, useEffect } from 'react';
import { BrowserRouter, Link, Switch, Route } from 'react-router-dom';
import './App.css';

function Nav(){
    return (
        <div className="nav">
            <Link to="/">
                <h1>Navigation</h1>
            </Link>
            <ul className="nav_links">
                <Link to="/manage_course">
                    <li>Manage Course</li>
                </Link>
                <Link to="manage_student">
                    <li>Manage Students</li>
                </Link>            
            </ul>

        </div>
    );
}

export default Nav;
